import React, { Component } from "react";
import { FaFacebook,FaInstagram,FaLinkedinIn,FaGithub,FaTwitter } from "react-icons/fa";
export default class SocialMedia extends Component {
  render() {
    return (
      <div class="social pt-3">
        <div class="row">
          <div class="col-2"><a href="https://www.linkedin.com/in/emre-g%C3%BCzel-6bb4101a2/" target="_blank" rel="noreferrer"><FaFacebook></FaFacebook></a></div>
          <div class="col-2"><a href="https://www.linkedin.com/in/emre-g%C3%BCzel-6bb4101a2/" target="_blank" rel="noreferrer"><FaInstagram></FaInstagram></a></div>
          <div class="col-2"><a href="https://www.linkedin.com/in/emre-g%C3%BCzel-6bb4101a2/" target="_blank" rel="noreferrer"><FaLinkedinIn></FaLinkedinIn></a></div>
          <div class="col-2"><a href="https://www.linkedin.com/in/emre-g%C3%BCzel-6bb4101a2/" target="_blank" rel="noreferrer"><FaGithub></FaGithub></a></div>
          <div class="col-2"><a href="https://www.linkedin.com/in/emre-g%C3%BCzel-6bb4101a2/" target="_blank" rel="noreferrer"><FaTwitter></FaTwitter></a></div>
          
        </div>
      </div>
    );
  }
}
